import './App.css';
import React, { useState } from 'react';
import { Routes,Route,BrowserRouter } from 'react-router-dom';
import axios from 'axios';
import './style.css';
import data from 'data.js';
import RowData from './RowData.js';
function App(){
   return(
    <>
      <div className='bg'>
          {data.map(i=>{
            return(
              // <div className='inner'>
                <RowData data={i}/>
              // </div>
            );
          })}         
      </div>
    </>
   );
}
export default App;
